note_models.css:
@keyframes textMove {
	from {
    	top:10px;
        color: #de8787;
        line-height: 0.7em;
    }

    to {
    	top:20px;
        color: white;
        line-height: 1.3em;
    }
}

@keyframes fadeAnim {
	0% {opacity: 0;}
	100% {opacity: 1;}
}

@keyframes boxShadow {
	from {box-shadow: 0 0 1px rgba(0, 0, 0, 0);}
	to {box-shadow: 0 10px 10px -10px rgba(0, 0, 0, 0.5);}
}

.card {
 font-family: serif;
 font-name: "Libre Baskerville";
 font-size: 20px;
 text-align: center;
 color: white;
 background-color: white;
}


div.promptBox {
  min-height: 150px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  box-shadow: 0 10px 10px -10px rgba(0, 0, 0, 0.5);
  opacity: 0;
  animation-name: fadeAnim;
  animation-duration: 0.8s;
  animation-timing-function: ease-in-out;
  animation-fill-mode: forwards;
}

div.answerBox {
  min-height: 150px;
}

div.exampleBox {
	background-color: #9df471;
	padding-top:25px;
}

div#known {
    animation-name: textMove;
    animation-duration: 0.3s;
    animation-timing-function: ease-in-out;
    animation-fill-mode:forwards;
}

.mainTexts {
    font-size: 30pt;
    font-weight: bold;
    text-align:center;
    letter-spacing: .06em;
    line-height: 1.3em;
    color:white;

    position:relative;
    top:10%;
    margin-left:20px;
    margin-right:20px;
}


.EN {background-color: #de8787}
.ES {background-color: #4ebecb}
.CA {background-color: #62cb20}
.UK {background-color: #b51f03}
.RO {background-color: #cb706d}

.hidden {display:none;}
.initial {display:initial;}
.visible {display:block}

.clarification_context:before {content: "("}
.clarification_context:after {content: ")"}

div#frontOnBack .only-front {display:none;}

div#badges_table {
	--display-badge:none;
}

div#badges_table div {
  vertical-align: middle;
  transform: perspective(1px) translateZ(0);
  animation: boxShadow 0.4s ease-in-out 0.4s 1 normal forwards;
}

div#badges_table div {
	display:var(--display-badge);
	padding-right:10px;
	width:100px;
	position:relative;
	top:15px;
}

